//web audio api context
const audioCtx = new AudioContext();
//base 64 audio
// let sampleAudio = new Audio(
//   "data:audio/x-wav;base64 ,"
// );
//file upload element
const file = document.querySelector(".fileUpload");

//container and canvas
const container = document.querySelector(".container");
const canvas = document.querySelector(".canvas1");
canvas.width = window.innerWidth; //set canvas width to window width
canvas.height = window.innerHeight; //set canvas height to winwdow height
const canvasCtx = canvas.getContext("2d"); //new 2d canvas

let audioSource;
let analyser;

//plays audio whenever container is clicked on
container.addEventListener("click", () => {
  const audio1 = document.querySelector(".audio1");
  audio1.src =
    "data:audio/x-wav;base64 ,";
  audio1.play();
  audioSource = audioCtx.createMediaElementSource(audio1);
  analyser = audioCtx.createAnalyser(); //something about frequency and timing data
  audioSource.connect(analyser);
  analyser.connect(audioCtx.destination);
  analyser.fftSize = 64; //number of audio samples
  const bufferLength = analyser.frequencyBinCount; //detail of frequency
  const dataArray = new Uint8Array(bufferLength); //converting to array of 8 bit int

  const barWidth = canvas.width / 2 / bufferLength;
  let barHeight; //changes according to music
  let x;

  const animate = () => {
    x = 0;
    canvasCtx.clearRect(0, 0, canvas.width, canvas.height);
    analyser.getByteFrequencyData(dataArray);
    //calling draw visualiser function
    drawVisualiser(bufferLength, x, barWidth, barHeight, dataArray);

    requestAnimationFrame(animate);
  };
  animate(); //calling animate function
});

//listen for file change event
file.addEventListener("change", () => {
  const files = file.files;
  const audio1 = document.querySelector(".audio1");
  audio1.src = URL.createObjectURL(files[0]);
  audio1.load(); ///update audio element
  audio1.play();

  audioSource = audioCtx.createMediaElementSource(audio1);
  analyser = audioCtx.createAnalyser(); //something about frequency and timing data
  audioSource.connect(analyser);
  analyser.connect(audioCtx.destination);
  analyser.fftSize = 64; //number of audio samples
  const bufferLength = analyser.frequencyBinCount; //detail of frequency
  const dataArray = new Uint8Array(bufferLength); //converting to array of 8 bit int

  const barWidth = canvas.width / 2 / bufferLength;
  let barHeight; //changes according to music
  let x;

  const animate = () => {
    x = 0;
    canvasCtx.clearRect(0, 0, canvas.width, canvas.height);
    analyser.getByteFrequencyData(dataArray);
    //calling draw visualiser function
    drawVisualiser(bufferLength, x, barWidth, barHeight, dataArray);
    requestAnimationFrame(animate);
  };
  animate(); //calling animate function
});

const drawVisualiser = (bufferLength, x, barWidth, barHeight, dataArray) => {
  //draws left side
  for (let i = 0; i < bufferLength; i++) {
    barHeight = dataArray[i] * 1.5; //louder sounds produce longer bars
    //changing color based on freq values
    const red = (i * barHeight) / 15;
    const green = barHeight / 1.3;
    const blue = (i * 10) / barHeight;
    canvasCtx.fillStyle = "#333";
    canvasCtx.fillRect(
      canvas.width / 2 - x,
      canvas.height - barHeight - 30,
      barWidth,
      15
    );
    canvasCtx.fillStyle = `rgb(${red},${green},${blue})`;
    canvasCtx.fillRect(
      canvas.width / 2 - x,
      canvas.height - barHeight,
      barWidth,
      barHeight
    );
    x += barWidth;
  }
  //draws right side
  for (let i = 0; i < bufferLength; i++) {
    barHeight = dataArray[i] * 1.5; //louder sounds produce longer bars

    //changing color based on freq values
    const red = (i * barHeight) / 15;
    const green = barHeight / 1.3;
    const blue = (i * 10) / barHeight;
    canvasCtx.fillStyle = "#333";
    canvasCtx.fillRect(x, canvas.height - barHeight - 30, barWidth, 15);
    canvasCtx.fillStyle = `rgb(${red},${green},${blue})`;
    canvasCtx.fillRect(x, canvas.height - barHeight, barWidth, barHeight);
    x += barWidth;
  }
};
